import React, { Component } from 'react';

import FilmsList from '../components/FilmsList';

class FilmsListContainer extends Component {
    render() {
        const films = [
            {
                title: 'Побег из Шоушенка (1994)',
                eng: 'The Shawshank Redemption',
                rating: '9.5'
            },
            {
                title: 'Зеленая миля (1999)',
                eng: 'The Green Mile',
                rating: '9.5'
            }
        ];

        return <FilmsList films={films} />
    }
}

export default FilmsListContainer;
